import React, { useEffect, useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { useAuth } from '../../contexts/AuthContext';
import api from '../../services/api';
import { toast } from 'react-hot-toast';
import { FiHome, FiTruck, FiPackage, FiPlus, FiArrowLeft, FiEdit2, FiTrash2 } from 'react-icons/fi';

const MyInterests = () => {
  const [interests, setInterests] = useState([]);
  const [loading, setLoading] = useState(true);
  const { user } = useAuth();
  const navigate = useNavigate();

  useEffect(() => {
    const fetchInterests = async () => {
      try {
        setLoading(true);
        console.log('Fetching interests...');
        const response = await api.interests.getMine();
        console.log('Interests API response:', response);
        
        if (response && response.data && response.data.success) {
          console.log('Interests data:', response.data.data);
          setInterests(Array.isArray(response.data.data) ? response.data.data : []);
        } else {
          console.error('Unexpected response format:', response);
          toast.error('Failed to load interests: Invalid response format');
          setInterests([]);
        }
      } catch (error) {
        console.error('Error fetching interests:', error);
        const errorMessage = error.response?.data?.message || 'Failed to fetch your interests';
        toast.error(errorMessage);
        setInterests([]);
      } finally {
        setLoading(false);
      }
    };

    fetchInterests();
  }, []);

  const getStatusBadge = (status) => {
    const statusMap = {
      pending: 'bg-yellow-100 text-yellow-800',
      approved: 'bg-green-100 text-green-800',
      rejected: 'bg-red-100 text-red-800'
    };
    
    return (
      <span className={`px-2 py-1 text-xs font-medium rounded-full ${statusMap[status] || 'bg-gray-100 text-gray-800'}`}>
        {status.charAt(0).toUpperCase() + status.slice(1)}
      </span>
    );
  };

  const getInterestIcon = (type) => {
    switch (type) {
      case 'house':
        return <FiHome className="h-5 w-5 text-blue-600" />;
      case 'car':
        return <FiTruck className="h-5 w-5 text-green-600" />;
      case 'other':
        return <FiPackage className="h-5 w-5 text-purple-600" />;
      default:
        return <FiPackage className="h-5 w-5 text-gray-600" />;
    }
  };

  const getInterestDetails = (interest) => {
    switch (interest.type) {
      case 'house':
        return (
          <div className="text-sm text-gray-600">
            <p>{interest.numRooms} rooms</p>
            <p>${interest.priceRange.min?.toLocaleString()} - ${interest.priceRange.max?.toLocaleString()}</p>
          </div>
        );
      case 'car':
        return (
          <div className="text-sm text-gray-600">
            <p>{interest.carModel} ({interest.carYear})</p>
            <p>${interest.priceRange.min?.toLocaleString()} - ${interest.priceRange.max?.toLocaleString()}</p>
          </div>
        );
      case 'other':
        return (
          <div className="text-sm text-gray-600">
            <p>{interest.itemType}</p>
            <p>${interest.priceRange.min?.toLocaleString()} - ${interest.priceRange.max?.toLocaleString()}</p>
          </div>
        );
      default:
        return null;
    }
  };

  const handleDelete = async (id) => {
    if (window.confirm('Are you sure you want to delete this interest?')) {
      try {
        await api.delete(`/api/interests/${id}`);
        setInterests(interests.filter(interest => interest._id !== id));
        toast.success('Interest deleted successfully');
      } catch (error) {
        console.error('Error deleting interest:', error);
        toast.error('Failed to delete interest');
      }
    }
  };

  if (loading) {
    return (
      <div className="flex justify-center items-center h-64">
        <div className="animate-spin rounded-full h-12 w-12 border-t-2 border-b-2 border-blue-500"></div>
      </div>
    );
  }

  return (
    <div className="max-w-6xl mx-auto p-6">
      <div className="flex justify-between items-center mb-6">
        <div>
          <h1 className="text-2xl font-bold text-gray-900">My Interests</h1>
          <p className="text-gray-600">View and manage your submitted interests</p>
        </div>
        <Link
          to="/dashboard/interests/new"
          className="inline-flex items-center px-4 py-2 border border-transparent rounded-md shadow-sm text-sm font-medium text-white bg-blue-600 hover:bg-blue-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-blue-500"
        >
          <FiPlus className="-ml-1 mr-2 h-5 w-5" />
          New Interest
        </Link>
      </div>

      {interests.length === 0 ? (
        <div className="bg-white shadow rounded-lg p-8 text-center">
          <FiPackage className="mx-auto h-12 w-12 text-gray-400" />
          <h3 className="mt-2 text-sm font-medium text-gray-900">No interests yet</h3>
          <p className="mt-1 text-sm text-gray-500">Get started by submitting a new interest.</p>
          <div className="mt-6">
            <Link
              to="/dashboard/interests/new"
              className="inline-flex items-center px-4 py-2 border border-transparent shadow-sm text-sm font-medium rounded-md text-white bg-blue-600 hover:bg-blue-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-blue-500"
            >
              <FiPlus className="-ml-1 mr-2 h-5 w-5" />
              New Interest
            </Link>
          </div>
        </div>
      ) : (
        <div className="bg-white shadow overflow-hidden sm:rounded-md">
          <ul className="divide-y divide-gray-200">
            {interests.map((interest) => (
              <li key={interest._id}>
                <div className="px-4 py-4 sm:px-6">
                  <div className="flex items-center justify-between">
                    <div className="flex items-center">
                      <div className="flex-shrink-0">
                        {getInterestIcon(interest.type)}
                      </div>
                      <div className="ml-4">
                        <div className="flex items-center">
                          <h3 className="text-lg font-medium text-gray-900 capitalize">
                            {interest.type}
                          </h3>
                          <div className="ml-2">
                            {getStatusBadge(interest.status)}
                          </div>
                        </div>
                        {getInterestDetails(interest)}
                        {interest.notes && (
                          <p className="mt-1 text-sm text-gray-500">{interest.notes}</p>
                        )}
                      </div>
                    </div>
                    <div className="ml-4 flex-shrink-0 flex space-x-2">
                      <button
                        onClick={() => navigate(`/dashboard/interests/${interest._id}/edit`)}
                        className="p-2 rounded-full text-gray-400 hover:text-blue-600 hover:bg-blue-50 focus:outline-none"
                      >
                        <FiEdit2 className="h-5 w-5" />
                        <span className="sr-only">Edit</span>
                      </button>
                      <button
                        onClick={() => handleDelete(interest._id)}
                        className="p-2 rounded-full text-gray-400 hover:text-red-600 hover:bg-red-50 focus:outline-none"
                      >
                        <FiTrash2 className="h-5 w-5" />
                        <span className="sr-only">Delete</span>
                      </button>
                    </div>
                  </div>
                  <div className="mt-2 sm:flex sm:justify-between">
                    <div className="sm:flex">
                      <p className="flex items-center text-sm text-gray-500">
                        Submitted on {new Date(interest.createdAt).toLocaleDateString()}
                      </p>
                    </div>
                    {interest.updatedAt !== interest.createdAt && (
                      <div className="mt-2 flex items-center text-sm text-gray-500 sm:mt-0">
                        <p>Last updated on {new Date(interest.updatedAt).toLocaleDateString()}</p>
                      </div>
                    )}
                  </div>
                </div>
              </li>
            ))}
          </ul>
        </div>
      )}
    </div>
  );
};

export default MyInterests;
